import React from "react";
import styled from "styled-components";

const Review = (props) => {

    return (
        <Container>
            <GrayCircle />
            <GrayCircle />
            <GrayCircle />
            <GrayCircle />
            <GrayCircle />
        </Container>
    );
}

const Container = styled.div`
    text-align: center;
    display: flex;
    justify-content: center;
    align-items: center;
`;

const YellowCircle = styled.div`
    width: 30px;
    height: 30px;
    border-radius: 30px;
    margin: 5px;
    background-color: yellow;
`;

const GrayCircle = styled.div`
    width: 30px;
    height: 30px;
    border-radius: 30px;
    margin: 5px;
    background-color: #eee;
`;

export default Review
